import React from "react"
import PropTypes from "prop-types"



Header.defaultProps = {
  text: "Feedback UI",
  bgColor: 'rgba(0, 0, 0, 0.4)',
  textColor: '#ff6a95'
}

Header.propTypes = {
  text: PropTypes.string,
}
export default Header
